import React from "react";
import { TETROMINOS } from "../tetrominos";

const Cell = (props) => (
  <div
    type={props.type}
    style={{
      backgroundColor: `${TETROMINOS[props.type].color}`,
      border: `${TETROMINOS[0] === 0 ? "0px solid" : "1px solid"}`,
      padding: "10px",
    }}
  ></div>
);

export default Cell;
